INSERT INTO `glossary` (`id`, `Caption`, `Data`) VALUES
(1, '2D', 'Object or drawing showing or having two dimensions, so that the object or drawing is lacking depth.<br>'),
(2, '3D', 'Object or drawing showing or having three dimensions, so that the object or drawing is showing a depth dimension.<br>'),
(3, 'AISI', 'Acronym for American Iron and Steel Institute.<br>'),
(4, 'ASTM', 'American Standard of Testing and Materials.<br>'),
(5, 'Axisymmetric', 'Deformation models require that the deforming geometry be symmetric around a central axis.<br>'),
(6, 'Axisymmetric drawing', 'The drawing of shapes having an axis of symmetry such as cones and round cups.<br>'),
(7, 'Bendability', 'It is defined as the minimum bending radius attainable by a given material.<br>'),
(8, 'Bending', 'A term typically applied to a metal forming process. It is the creation of a formed feature by angular displacement of a sheet metal workpiece.<br>'),
(9, 'Billet', 'Billet is the product obtained from a further reduction by hot rolling, (cross sectional area &gt 40x40 mm<sup>2</sup>). <br><br><center><img src="images/MetalForming/billet.jpg" width="400" height="200"><br>Figure: 1 - Billet</center>'),
(10, 'Blanking', 'The operation of punching, cutting, or shearing a piece out of stock to a predetermined shape. The article punch out is called blank.<br>'),
(11, 'Blocking', 'Another coating defect consisting of the adhesion of two adjoining coatings or materials. Usually this term refers to the coating on one side of coated plate being tacky or sticky and adhering to the adjacent sheet.<br>'),
(12, 'Bloom', 'Bloom is the product of first breakdown of ingot (cross sectional area &gt; 230 cm<sup>2</sup>).<br><br><center><img src="images/MetalForming/bloom.jpg" width="400" height="200"><br>Figure: 2 - Bloom</center>'),
(13, 'Bolster plate', 'That plate to which dies can be fastened so the assembly is secured to the top surface of a press bed.<br>'),
(14, 'Bottoming', 'Forming operation in which the punch and the die are closed completely on the workpiece.<br>'),
(15, 'Buckling', 'An uncontrolled deformation pattern perpendicular to the surface of a sheet caused by compressive stresses.<br>'),
(16, 'Bulging', 'The process of increasing the diameter of a cylindrical shell (usually to a spherical shape) or of expanding the outer walls of any shell or box shape whose walls were previously straight.<br>'),
(17, 'Closed-die', 'A tool that creates a work-shape-imposing orifice, cavity, or passageway.<br>'),
(18, 'Coining', 'A compressive metal flowing action. A closed-die squeezing operation in which all surfaces of a workpiece are confined or restrained, resulting in a well-defined imprint of the die on the work.<br>'),
(19, 'Cold heading', 'The process of upsetting the ends of a bar, wires, or tube stock while cold.<br>'),
(20, 'Cold rolled', 'Rolling metal at a temperature below the recrystallization temperature point of the metal to create strain hardening (work-hardening).<br>'),
(21, 'Cold worked', 'Material hardened naturally through forming at ambient temperatures.<br>'),
(22, 'Cold working', 'The plastic deformation of metal under conditions of temperature and strain rate that induce strain hardening.<br>'),
(23, 'Compound die', 'Tool used to pierce, form and blank a part at the same time, with one stroke of the press.<br>'),
(24, 'Corrugating', 'The forming of sheet metal into a series of straight, parallel alternate ridges and grooves with a rolling mill equipped with matched roller dies or a press brake equipped with specially shaped punch and die.<br>'),
(25, 'Corrugations', 'Transverse ripples caused by a variation in strip shape during hot or cold reduction.<br>'),
(26, 'Crank press', 'A mechanical press whose slides are actuated by a crankshaft.<br>'),
(27, 'Crimping', 'The forming of relatively small corrugations in order to set down and lock a seam, to create an arc in a strip of metal, or to reduce an existing arc or diameter.<br>'),
(28, 'Crown', 'The upper part (head) of a press frame. On hydraulic presses, the crown usually contains the cylinder; on mechanical presses, the crown contains the drive mechanism.<br>'),
(29, 'Cupping', 'The first step in deep drawing.<br>'),
(30, 'Curling', 'The act of forming an edge of circular cross section along a sheet, workpiece, or at the end of a shell or tube.<br>'),
(31, 'Cushion pins', 'Metal pins used in conjunction with a die cushion to transfer pressure from the cushion to the bottom of a die pad.<br>'),
(32, 'Deep drawing', 'The metal forming fabrication process of flat rolled steel to make drawn parts. The part is mechanically formed through or in a die. The blank diameter is reduced; the blank contracts circumferentially as it is drawn radially inward.<br>'),
(33, 'Deformation', 'Deformation is forming the solid material into shape by applying forces to it. The most well known deformation processes are forging, rolling and extrusion, which can produce components of a variety of shapes.<br>'),
(34, 'Deformation Zone', 'The portion of the workpiece where plastic deformation is talking place during the forming process.<br>'),
(35, 'Die', 'Tool with a void or cavity that is precisely fitted to a punch used to solid, molten, or powdered metal primarily because of the shape of the tool itself.<br>'),
(36, 'Die block', 'A block, often made of heat treated steel, into which desired impressions are machined or sunk and from which closed die forgings or sheet metal stampings are produced using hammers or presses. In forging, die blocks are usually used in pairs, with part of the impression in one of the blocks and the rest of the impression in the other.<br>'),
(37, 'Die cavity', 'The machined recess that gives a forging or stamping its shape.<br>'),
(38, 'Die clearance', 'Amount of space between the punch and die opening.<br>'),
(39, 'Die height', 'The distance from the finished top face of the upper shoe to the finished bottom face of the lower shoe immediately after the die operation and with the work in the die.<br>'),
(40, 'Die holder', 'A plate or block, on which the die block is mounted, having holes or slots for fastening to the bolster plate or the bed of the press.<br>'),
(41, 'Die impression', 'The portion of the die surface that shapes a forging or sheet metal part.<br>'),
(42, 'Die set', 'The assembly of the upper and lower die shoes (punch and die holders), usually including the guide pins, guide pin bushings, and heel blocks.<br>'),
(43, 'Die stamping', 'The general term for a sheet metal part that is formed, shaped, or cut by a die in a press in one or more operations.<br>'),
(44, 'Double-action mechanical press', 'A press having two independent parallel movements by means of two slides, one moving within the other. The inner slide or plunger is usually operated by a crankshaft and the outer or blank holder slide, which dwells during the drawing operation, is usually operated by a toggle mechanism or by cams.<br>'),
(45, 'Drawing', 'A term used for a variety of forming operations, such as deep drawing a sheet metal blank; and drawing rod, wire, and tube. The usual drawing process with regard to sheet metal working in a press is a method for producing a cup-like form from a sheet metal disk by holding it firmly between blank holding surfaces to prevent the formation of wrinkles while the punch travel produces the required shape.<br>'),
(46, 'Embossing', 'A process for producing raised or sunken designs or relief in sheet material by means of male and female dies, theoretically with no change in metal thickness or by passing sheet or a strip of metal by passing between rolls of desired pattern.<br>'),
(47, 'Extruded hole', 'Pierced and formed hole in sheet metal in which the metal has been stretched creating a tubular shape.<br>'),
(48, 'Extrusion', 'A metal forming process in which a punch compresses a billet (hot or cold) confined in a container so that the billet material flows through a die in the same direction as the punch.<br>'),
(49, 'Finite Element Method (FEM)', 'A method of analysis developed for prediction, practical forming of the instantaneous velocities, strain rates, strains, stresses and temperatures within the deforming metal.<br>'),
(50, 'Flanging', 'A variable that is intentionally changed in a controlled manner during an experiment to observe its effects on the response variable, sometimes called an independent variable or causal variable.<br>'),
(51, 'Flash', 'The excess metal attached to a part after a forming operation.<br>'),
(52, 'Flattening dies', 'Dies used to flatten sheet metal hems; that is, dies that can flatten a bend by closing it.<br>'),
(53, 'Floating die', 'A die mounted in a die holder or a punch mounted in its holder such that a slight amount of motion compensates for tolerance in the die parts, the work, or the press.<br>'),
(54, 'Forging Stroke', 'The distance between the slide position when the upper die touches the workpiece and the bottom dead centre.<br>'),
(55, 'Formability', 'The ease with which a metal can be shaped through plastic deformation.<br>'),
(56, 'Formed', 'A material that has undergone plastic deformation between tools (dies) to obtain the final configuration.<br>'),
(57, 'Forming', 'The plastic deformation of a billet or a blanked sheet between tools (dies) to obtain the final configuration.<br>'),
(58, 'Frictional Shear Factor', 'A constant of proportionality (m) that enables one to express friction quantitatively. When m=1, then friction is a maximum and the friction shear stress is equal to the shear stress of the deforming material. For “perfect” lubrication m=0, and there is no friction.<br>'),
(59, 'Grain size', 'The average diameter of grains in the metal under consideration, or alternatively, the number of grains per unit area.<br>'),
(60, 'Hem', 'Edge of material doubled over onto itself for the purpose of safe handling or to increase edge stiffness.<br>'),
(61, 'Hemming', 'A bend of 180° (made in two steps). First, a sharp-angle bend is made and then the bend is closed using a flat punch and a die.<br>'),
(62, 'Hemming die', 'A die which folds the edge of the part back over on itself.<br>'),
(63, 'Hydraulic press', 'A machine that exerts working pressure by hydraulic means. Longer strokes than mechanical presses, and develop full force throughout the stroke. Stroke motion is of uniform speed, especially adapted to deep drawing operations.<br>'),
(64, 'Hydraulics', 'If energy transfer is in the form of pressurized liquid flow then it is called hydraulics. The oil is kept in a reservoir and the pump draws it in and pushes it into the system.<br>'),
(65, 'Ironing', 'An operation used to increase the length of a tube or cup through reduction of wall thickness and outside diameter, the inner diameter remaining unchanged while the surface is smoothed. Thinning the walls of deep drawn articles by reducing the clearance between punch and die.<br>'),
(66, 'Lifter', 'A mechanism for raising a part in a die to a height for advancing it to another station, as in a progressive die, or for ejecting it from the die.<br>'),
(67, 'Mechanical press', 'A forging press with an inertia flywheel, a crank and clutch, or other mechanical device to operate the ram.<br>'),
(68, 'Mechanical working', 'Plastic deformation or other physical change to which metal is subjected, by rolling, hammering, drawing, etc. to change its shape, properties or structure.<br>'),
(69, 'Necking', 'Strip condition caused by the application of too much tension that causes the metal strip to become narrower (or stretched).<br>'),
(70, 'Percentage Reduction', 'The initial cross-sectional area of the specimen minus the final cross-sectional area divided by the initial area of the specimen.<br>'),
(71, 'Pierce', 'To cut, shear, or punch an opening in sheet metal, strip, plate or parts such as a slot or a hole.<br>'),
(72, 'Pierce block', 'An individual die part that contains one or more pierce holes or die buttons.<br>'),
(73, 'Piercing', 'The general term for cutting (shearing or punching) openings, such as holes and slots, in sheet material, plate, or parts.<br>'),
(74, 'Piercing die', 'A die which cuts out a slug, which is usually scrap, in sheet or plate material.<br>'),
(75, 'Plane-Strain', 'Deformation models where material flow occurs in a single plane.<br>'),
(76, 'Plastic deformation', 'Permanent deformation occurring in forming of metal after elastic limits have been exceeded under the action of applied stresses. The ability of metals to flow in a plastic manner without fracture is the fundamental basis for all metal forming processes.<br>'),
(77, 'Plasticity', 'The property of a substance that permits it to undergo a permanent change in shape without rupture.<br>'),
(78, 'Plate', 'Plate is the product with a thickness > 6 mm.<br><br><center><img src="images/MetalForming/plate.jpg" width="400" height="200"><br>Figure: 3 - Plate</center>'),
(79, 'Pneumatics', 'If energy transfer is in the form of compressed airflow then it is known as pneumatics.<br>'),
(80, 'Preformed part', 'A partially formed part which will be subjected to one or more subsequent operations. Usually done after a blank die and prior to going into a draw die.<br>'),
(81, 'Press', 'A machine having a stationary bed or anvil and a slide (ram or hammer) which has a controlled reciprocating motion toward and away from the bed surface and at right angle to it. The slide is guided in the frame of the machine to give a definite path of motion.<br>'),
(82, 'Press capacity', 'The rated force a press is designed to exert at a predetermined distance above the bottom of the stroke of the slide.<br>'),
(83, 'Progressive die', 'A die with two or more stations arranged in line for performing two or more operations on a part one operation usually being performed at each station. The parts are connected by a carrier strip until final parting or cut-off operation.<br>'),
(84, 'Punch', 'The male part of a die-as distinguished from the female part, which is called the die. The punch is usually the upper member of the complete die assembly and is mounted on the slide or in a die set for alignment. It is the movable part that forces the metal into the die in equipment for sheet drawing, blanking, coining, embossing and the like.<br>'),
(85, 'Punching', '(1) Shearing holes in sheet metal with punch and die.<br>(2) The die shearing of a closed contour in which the sheared out sheet metal part is scrap.<br>\r\n (3) Forming metal components using a punch.<br>'),
(86, 'Ram Stroke', 'Displacement of the press ram.<br>'),
(87, 'Re-crystallization Temperature', 'The temperature at which metallurgical transformation takes place with increasing temperature. It is usually the range of temperature in which the strain-hardening disappears rapidly.<br>'),
(88, 'Ring', 'That part of a forming die, which holds the blank by pressure against a mating surface of the die to control metal flow and prevent wrinkling.<br>'),
(89, 'Roller', 'A deforming instrument having a work-engaging, work-deforming, peripheral surface which is generated by a line revolving about an axis.<br>'),
(90, 'Rolling', 'A term applied to the operation of shaping and reducing metal in thickness by passing it between rolls which compress, shape and lengthen it following the roll pattern.<br>'),
(91, 'Rolling mills', 'Equipment used for rolling down metal to a smaller size or to a given shape employing sets of rolls tie contours of which determine or fashion the product into numerous intermediate and final shapes, e.g., blooms, slabs, rails, bars, rods, sections, plates, sheets and strip.<br>'),
(92, 'Screw press', 'A high-speed press in which the ram is activated by a large screw assembly powered by a drive mechanism.<br>'),
(93, 'Shear', 'A type of cutting operation in which the metal object is cut by means of a moving blade and fixed edge or by a pair of moving blades that may be either flat or curved.<br>'),
(94, 'Shearing', 'Cutting force applied perpendicular to material causing the material to yield and break.<br>'),
(95, 'Sheet', 'Sheet is the product with a thickness < 6 mm and width > 600 mm.<br><br><center><img src="images/MetalForming/sheet.jpg" width="400" height="200"><br>Figure: 4 - Sheet</center>'),
(96, 'Sheet forming', 'The plastic deformation of a piece of sheet metal by tensile loads into a three-dimensional shape, often without significant changes in sheet thickness or surface characteristics.<br>'),
(97, 'Shut height', 'Clearance in a press between ram and bed with ram down and adjustment up.<br>'),
(98, 'Sizing', 'Secondary forming or squeezing operations needed to square up, set down, flatten, or otherwise correct surfaces to produce specified dimensions and tolerances.<br>'),
(99, 'Slab', 'Slab is the hot rolled ingot, (cross sectional area &gt; 100 cm<sup>2</sup> and with a width <u>&gt;</u> 2 x thickness).<br><br><center><img src="images/MetalForming/slab.jpg" width="400" height="200"><br>Figure: 5 - Slab</center>'),
(100, 'Staking', 'Method of fastening using displaced material for retention.<br>'),
(101, 'Stamping', 'A term used to refer to various press forming operations in coining, embossing, blanking, and pressing. Forming metals using pressure into the surface of a metal, usually strip or sheet.<br>'),
(102, 'Stretching', 'The extension of the surface of a sheet in all directions. In stretching, the flange of the flat blank is securely clamped.<br>'),
(103, 'Strip', 'A flat-rolled metal product of some maximum thickness and width arbitrarily dependent on the type of metal; narrower than sheet. A sheet of metal whose length is many times its width. It has thickness < 6 mm and width < 600 mm.<br><br><center><img src="images/MetalForming/strip.jpg" width="400" height="200"><br>Figure: 6 - Strip</center>'),
(104, 'Stroke', 'Ram travel from top dead centre (TDC) to bottom dead centre (BDC).<br>'),
(105, 'Stroke of a press', 'The reciprocating motion of a press slide, specified as the number of inches between the terminal points of the motion.<br>'),
(106, 'Toggle press', 'Any mechanical press in which a slide or slides are actuated by one or more toggle joints.<br>'),
(107, 'Workpiece', 'A piece of metal or object that is intended to be subjected to, or is being subjected to, any of the metal forming processes.<br>');
